(self.webpackChunkdemo=self.webpackChunkdemo||[]).push([[88273],{88273:t=>{t.exports='<div class="t-list-search">\n    <tui-textfield iconStart="@tui.search">\n        <input\n            placeholder="Search categories"\n            tuiAutoFocus\n            tuiTextfield\n            [focused]="true"\n            [(ngModel)]="value"\n        />\n    </tui-textfield>\n</div>\n<hr />\n<tui-data-list\n    emptyContent="No results found"\n    (keydown)="onKeyDown($event.key)"\n>\n    @if (!value) {\n        <tui-opt-group>\n            <button\n                tuiOption\n                type="button"\n                [value]="all"\n            >\n                All\n            </button>\n            @for (item of items(); track item) {\n                <button\n                    tuiOption\n                    type="button"\n                    [value]="item.items"\n                >\n                    {{ item.name }} only\n                </button>\n            }\n        </tui-opt-group>\n    }\n    @for (item of items(); track item) {\n        @let filtered = item.items | tuiFilter: filter : value;\n\n        <tui-opt-group [label]="item.name">\n            @if (filtered.length) {\n                <tui-opt-group tuiMultiSelectGroup>\n                    @for (item of filtered; track item) {\n                        <button\n                            tuiOption\n                            type="button"\n                            [value]="item"\n                        >\n                            {{ item }}\n                        </button>\n                    }\n                </tui-opt-group>\n            }\n        </tui-opt-group>\n    }\n</tui-data-list>\n'}}]);